        detail (index) {
            this.$router.push({path:'/main/accountDetail',query:this.tableData[index]});
        },
        editInfo (index) {
            this.accountInfo = this.tableData[index]
            this.toggleAccountProfileShowStatus('modify');
        },
        remove (index) {
            this.$Modal.confirm({
                title: '警告',
                content: '确定删除此数据?',
                onOk: () => {
                    this.tableData.splice(index, 1);
                },
            });
        },
        toggleAccountProfileShowStatus(type){
            if(!this.accountProfileStatus){
                this.accountProfileType = type
                if(type==='add'){
                    this.accountInfo = {
                        name: '',
                        gender: '',
                        nation: '',
                        birthday: '',
                        address: '',
                        cardNo: '',
                        picture: ''
                    }
                }
            }
            this.accountProfileStatus = !this.accountProfileStatus
        },
        toggleModifyPasswordShowStatus(){
            this.modifyPasswordShowStatus = !this.modifyPasswordShowStatus
        },
        initList () {
            this.listLoading = true
            setTimeout(() => {
                let filteredData = this.fakeDatas
                console.log(this.listQuery.name)
                if(this.listQuery.name){
                    filteredData = this.fakeDatas.filter((data)=>data.name.indexOf(this.listQuery.name)>-1)
                }
                this.tableData = filteredData.slice((this.listQuery.current-1)*this.listQuery.size,this.listQuery.current*this.listQuery.size)
                this.listQuery = Object.assign({}, this.listQuery, {total: filteredData.length})
                this.listLoading = false
            },1000)
        },
        search () {
            this.$refs.accountPage.rest()
            this.initList()
        },
